(524, '<p class="MsoNormal" style="margin-bottom:0in;margin-bottom:.0001pt"><span lang="IN">Salah satu kebiasaan baik yang dilakukan siswa adalah menyisihkan uang jajannya untuk dikumpulkan dan digunakan untuk membeli barang kebutuhannya. Citra dan Syifa menabung agar dalam waktu bersamaan dapat membeli sepatu baru. Harga sepatu Citra adalah dua kali harga sepatu Syifa. Pada saat ini Citra mempunyai uang simpanan Rp40.000,00 dan akan menabung setiap hari Rp3.500,00, sedangkan Syifa saat ini mempunyai simpanan Rp10.000,00 dan akan menabung setiap hari Rp2.000,00. Harga sepatu yang akan dibeli Syifa adalah...</span></p>', 20, '<p class="MsoNormal" style="margin-bottom:0in;margin-bottom:.0001pt"><span lang="IN">Rp80.000,00</span></p>', '<p class="MsoNormal" style="margin-bottom:0in;margin-bottom:.0001pt"><span lang="IN">Rp90.000,00</span></p>', '<p class="MsoNormal" style="margin-bottom:0in;margin-bottom:.0001pt"><span lang="IN">Rp120.000,00</span></p>', '<p class="MsoNormal" style="margin-bottom:0in;margin-bottom:.0001pt"><span lang="IN">Rp140.000,00</span></p>', '<p class="MsoNormal" style="margin-bottom:0in;margin-bottom:.0001pt"><span lang="IN">Rp180.000,00</span></p>', 'A', 1, NULL),
